import './App.css';
import { Component } from 'react';

class App extends Component {
  constructor() {
    super()
    this.state = {
     monsters: [
      {
      name:'AKSHAY Kumar'
     },
    {
      name:'Neha Galhotra'
     },
    {
      name:'Akshara Chaudhary'
     },
    ]
  };
  }
  render() {
    return (
      <div className="App">
        { this.state.monsters.map((input) => {
          return <h1>{input.name}</h1>
        })}
      </div>
    );
  }
}

export default App;
